INSERT INTO `recipes` (`id`, `user_id`, `name`, `summary`, `description`, `image`) VALUES
(10, 5, 'Microwave shakshuka', 'Whip up shakshuka, a Middle Eastern favourite.', 'Method\nSTEP 1\nBrush a microwave bowl or dish with a little of the oil. Stir the passata, garlic and salsa together and season well. Tip into the bowl and make a dip in the centre. Break in the egg, then prick the yolk with the tip of a sharp knife.\n\nSTEP 2\nCover the bowl with its lid or clingfilm. Microwave on high for 1 min, and then in 20 sec bursts until the white is set. Scatter over the coriander and serve with the warmed pitta.', );
INSERT INTO `recipes` (`id`, `user_id`, `name`, `summary`, `description`, `image`) VALUES
(11, 5, 'Easy mango chutney naan breads', 'The perfect accompaniment to a veggie curry', 'Method\nSTEP 1\nMix the flour in a bowl with 2 tsp salt and the yeast. Make a well, add the water and oil then mix to a rough dough. Leave it to sit for 5 mins as it is. Flour the work surface and hands, then knead the dough for 1-2 mins until smooth and springy. Leave it to sit for 10 mins in a warm place, covered with oiled clingfilm. Don’t worry about waiting for it to double in size.\n\nSTEP 2\nCut the dough in to 8 even pieces, roll each one out into a thin circle. Spoon 1 tsp mango chutney into the middle of the circle, then fold one side over to make a semi-circle shape. Press the edges together. Heat the grill to high. Dust a baking sheet with flour, then grill the breads for 1 ½-2 mins on each side until puffed and golden. You’ll need to do this in a few batches. Serve with the curry.', );
INSERT INTO `recipes` (`id`, `user_id`, `name`, `summary`, `description`, `image`) VALUES
(12, 5, 'Tuna & sweetcorn fish cakes', 'a healthy, budget-friendly supper', 'Method\nSTEP 1\nCook the potatoes in boiling salted water until really tender. Drain and allow to steam-dry in a colander. Tip into a bowl, season and mash. Stir in the mayonnaise, tuna, sweetcorn and chives or parsley. Shape into 4 cakes and chill until cold and firm.\n\nSTEP 2\nDip each cake into the egg, letting the excess drip off, then coat in the breadcrumbs. Chill for 15 mins.\n\nSTEP 3\nHeat a little of the oil in a pan and gently fry the cakes for 2-3 mins on each side until golden. You may need to do this in batches – keep warm in a low oven. Serve with extra mayonnaise and salad leaves.', );
INSERT INTO `recipes` (`id`, `user_id`, `name`, `summary`, `description`, `image`) VALUES
(13, 5, 'Chicken & brown rice', 'Combine the classic flavours of chicken and chorizo with kale and rice', 'Method\nSTEP 1\nHeat the oil in a frying pan over a high heat and fry the chicken for 3 mins. Stir in the chorizo and cook for 2 mins more until the chicken is light golden and the chorizo has released its fat. Scoop the chicken and chorizo into a bowl using a slotted spoon, leaving as much oil in the pan as you can. Set aside.\n\nSTEP 2\nTip the leek and red pepper into the pan and cook for 2 mins, stirring frequently until slightly softened. Add the kale and fry for 1 min more until the leaves have just started to wilt at the edges.\n\nSTEP 3\nDrizzle in the soy sauce and vinegar and scatter in the rice, breaking up any large chunks with a wooden spoon. Stir the chicken and chorizo back into the pan and toss everything together to combine. Cook for 3 mins until the rice is heated through, then serve.', );
INSERT INTO `recipes` (`id`, `user_id`, `name`, `summary`, `description`, `image`) VALUES
(14, 5, 'The Twins Rice Balls', 'HONOR THE BOOK OF BOBA FETT‘S SIBLING DUO WITH HUTT TWINS RICE BALLS', 'Step 1: Rinse the rice until water runs clear. \n\nStep 2: In a large saucepan add the rice and 3 cups of water. Bring to a boil. Cover and reduce heat, then simmer for 20 minutes until the water is absorbed. Remove from heat, let sit for 10 minutes, covered.\n\nStep 3: Fluff rice and let cool slightly. Divide the rice evenly onto two sheets of plastic wrap. Use the plastic wrap to form the shapes of both Hutts.\n\nStep 4: Unwrap and sprinkle with furikake seasoning, one pink, and one green. Set aside.\n\nStep 5: Cut the seaweed into the shape of a mouth and nostrils and place onto the rice balls.\n\nStep 6: Cut mango into 4 small eye shapes and place onto each rice ball. Place a black sesame seed into the center of the mango to create the pupil. Serve immediately.\n\nSo ready a litter. The Twins Rice Balls will make a grand entrance for your next meal.', );
INSERT INTO `recipes` (`id`, `user_id`, `name`, `summary`, `description`, `image`) VALUES
(15, 5, 'Bacon and Eggs', 'Bacon and eggs is a simple, easy and wholesome meal', 'Step 1 Pan fry the bacon\nFry bacon in a pan on medium-low flame until they are crispy. Transfer them into a plate.\n\nStep 2 Cook eggs and cherry tomatoes\nUse the same pan to cook eggs. Crack eggs in the pan and cook them as you like; sunny side up. Cover the pan so that the egg cooks properly. Slice cherry tomatoes and cook in the pan at the same time.\n\n\nStep 3 Season the eggs and serve with bacon\nAdd seasoning and garnish with chopped fresh parsley. Serve bacon and eggs hot.\n', );
